      content: >-
        Hello hello hello!

        A gnomish friend, I do know!

        Hey gang. Real talk.

        This overhaul of the map comes from some serious friends who I love dearly and I give all my little heart out to.

        Rose, TJ. You're what I love to see.

        My knights in shining armor.

        Picking me up over your shoulder, carrying me off back home after rescuing me from my evil captor (I keep getting lured into their evil lairs, I can't say no to Dog Women).

        Anyways.

        I also give my love to June, Mono, Cami, Dagmire, Morgan, KC and finally Biggie Smalls.

        With love, enjoy Glacier while we still have it

        (Until Wallflower completes her whole re-do of the map!)
